import React, { useEffect, useState } from "react";

export default function Student() {
  const [reports, setReports] = useState([]);
  const [msg, setMsg] = useState("");
  const [rating, setRating] = useState({
    reportId: "",
    rating: 5,
    feedback: "",
    studentId: 1, // hardcode for now; later replace with logged-in user
  });

  // Load reports
  useEffect(() => {
    fetch("http://localhost:5000/api/reports")
      .then((res) => res.json())
      .then((data) => {
        if (Array.isArray(data)) setReports(data);
        else setReports([]);
      })
      .catch((err) => {
        console.error(err);
        setMsg("‚ùå Failed to load reports");
      });
  }, []);

  // Handle form change
  const handleChange = (e) =>
    setRating({ ...rating, [e.target.name]: e.target.value });

  // Submit rating
  const submitRating = async (e) => {
    e.preventDefault();
    if (!rating.reportId) {
      setMsg("‚ùå Please select a report before submitting.");
      return;
    }
    try {
      const res = await fetch("http://localhost:5000/api/ratings", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(rating),
      });
      if (res.ok) {
        setMsg("‚úÖ Rating submitted successfully!");
        setRating({ reportId: "", rating: 5, feedback: "", studentId: 1 });
      } else {
        const errMsg = await res.json();
        setMsg("‚ùå Failed: " + (errMsg.error || "Unknown error"));
      }
    } catch (err) {
      setMsg("‚ùå Error: " + err.message);
    }
  };

  return (
    <div>
      <h2 className="mb-4">üéì Student Dashboard</h2>
      {msg && <div className="alert alert-info">{msg}</div>}

      {/* Reports Section */}
      <h3 className="mb-3">Available Reports</h3>
      {reports.length === 0 ? (
        <p>No reports found</p>
      ) : (
        <div className="row">
          {reports.map((r) => (
            <div key={r.id} className="col-md-6 col-lg-4 mb-4">
              <div className="card shadow-sm h-100">
                <div className="card-body">
                  <h5 className="card-title">{r.course_name}</h5>
                  <h6 className="card-subtitle mb-2 text-muted">
                    {r.course_code} | {r.date_of_lecture}
                  </h6>
                  <p className="card-text">
                    <strong>Topic:</strong> {r.topic_taught} <br />
                    <strong>Lecturer:</strong> {r.lecturer_name} <br />
                    <strong>Venue:</strong> {r.venue}
                  </p>
                </div>
                <div className="card-footer text-end">
                  <small className="text-muted">Week {r.week_of_reporting}</small>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}

      {/* Rating Form */}
      <h3 className="mb-3">Submit Rating</h3>
      <div className="card shadow-sm mb-4">
        <div className="card-body">
          <form onSubmit={submitRating}>
            <div className="mb-3">
              <label className="form-label">Select Report</label>
              <select
                name="reportId"
                value={rating.reportId}
                onChange={handleChange}
                className="form-select"
              >
                <option value="">-- Select Report --</option>
                {reports.map((r) => (
                  <option key={r.id} value={r.id}>
                    {r.course_name} - {r.topic_taught}
                  </option>
                ))}
              </select>
            </div>

            <div className="mb-3">
              <label className="form-label">Rating (1-5)</label>
              <input
                type="number"
                name="rating"
                min="1"
                max="5"
                value={rating.rating}
                onChange={handleChange}
                className="form-control"
              />
            </div>

            <div className="mb-3">
              <label className="form-label">Feedback</label>
              <textarea
                name="feedback"
                placeholder="Enter feedback"
                value={rating.feedback}
                onChange={handleChange}
                className="form-control"
              />
            </div>

            <button className="btn btn-primary">Submit Rating</button>
          </form>
        </div>
      </div>
    </div>
  );
}
